  false,\n\t\"url\": null,\n\t\"notes\": \"This memo describes the water quality conditions
  in the Newlands Project.  Overall water quality degrades from the upper to lower
  end of the Project.  Return flows from irrigated and drained land have increased
  TDS levels.  The levels are variable among sites; water entering the wetlands from
  drainage ditches was 600 mg/L on average from 1967 to 1986.\",\n\t\"license_title\":
